(function () {
  document.addEventListener('DOMContentLoaded', () => {
    const {
        getValue, 
        setValue, 
        addEventListener, 
        querySelector,
        notify
    } = window.dynamicFields.DynamicFieldsExamples_SimpleImageGallery_Value;

    const gallery = querySelector('simple-image-gallery');
    gallery.onChange = (object) => {
      setValue(object);
      notify();
    };

    addEventListener('value', (object) => {
        console.log(object);
        if (object?.src) {
            gallery.setImage(object?.src);
        }
    }, {init: true});
  });
})();
